import{_ as e,c as a,o as r,aB as o}from"./chunks/framework.uEqVN41L.js";const f=JSON.parse('{"title":"大连理工大学","description":"","frontmatter":{"title":"大连理工大学","author":["半生","高桐","七翼式","Integral"],"wordCount":5266},"headers":[],"relativePath":"campus/DLUT.md","filePath":"campus/DLUT.md","lastUpdated":1745928745000}'),l={name:"campus/DLUT.md"};function n(s,t,i,d,h,c){return r(),a("div",null,t[0]||(t[0]=[o('<table tabindex="0"><thead><tr><th style="text-align:center;">项目</th><th style="text-align:center;">情况</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">宿舍独卫</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">宿舍独浴</td><td style="text-align:center;">✓</td><td style="text-align:center;">凌水主校区：仅限博士 &amp; 留学生宿舍；开发区校区：仅限新宿舍楼（学生第七宿舍）A 区</td></tr><tr><td style="text-align:center;">第三卫生间</td><td style="text-align:center;">-</td><td style="text-align:center;">部分新建教学楼有无障碍卫生间</td></tr><tr><td style="text-align:center;">军训协商减免</td><td style="text-align:center;">-</td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">军训凭医疗材料减免</td><td style="text-align:center;">-</td><td style="text-align:center;">可凭医学证明旁听</td></tr><tr><td style="text-align:center;">军训不管头发</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">体育协商减免</td><td style="text-align:center;">-</td><td style="text-align:center;">有太极拳、舞龙舞狮等轻度体育课程</td></tr><tr><td style="text-align:center;">体育凭医疗材料减免</td><td style="text-align:center;">-</td><td style="text-align:center;">通过相关医疗证明可进入康复班进修学分</td></tr><tr><td style="text-align:center;">医保使用</td><td style="text-align:center;">-</td><td style="text-align:center;">校园医保仅限于大病（无法用于药瓶购买以及激素检查）</td></tr><tr><td style="text-align:center;">校医院服务</td><td style="text-align:center;">?</td><td style="text-align:center;">可以做基本检查和日常处方药的购买（激素检查未知）</td></tr></tbody></table><h2 id="概述" tabindex="-1">概述 <a class="header-anchor" href="#概述" aria-label="Permalink to &quot;概述&quot;">​</a></h2><p><strong>学校简介</strong><sup class="footnote-ref"><a href="#fn1" id="fnref1">[1]</a></sup></p><p><a href="https://www.dlut.edu.cn/" target="_blank" rel="noreferrer">大连理工大学</a>（Dalian University of Technology, DLUT/DUT）</p><ul><li>大连理工大学 1949 年 4 月建校，时为大连大学工学院；</li><li>1950 年 7 月大连大学建制撤销，大连大学工学院独立为大连工学院；</li><li>1960 年 10 月被确定为教育部直属全国重点大学；1986 年 4 月设立研究生院；</li><li>1988 年 3 月更名为大连理工大学；1996 年启动实施 “211 工程” 建设，教育部、辽宁省、大连市共建大连理工大学；</li><li>2001 年启动实施 “985 工程” 建设，教育部、辽宁省、大连市重点共建大连理工大学；</li><li>2003 年被中央确定为中管干部学校。</li><li>2012 年 12 月教育部正式批准大连理工大学依照 “统筹规划、错位发展、坚持标准、创新模式” 的指导思想建设盘锦校区，与主校区同标准、同档次、同水平办学。</li><li>2017 年 9 月，经国务院批准，入选世界一流大学 A 类建设高校名单；</li><li>2022 年 2 月，入选国家第二轮 “双一流” 建设高校名单。</li></ul><p>知道为什么是 DUT ？正常英文应该是 Dalian University of Science and Technology，缩写就是 DUST，意为灰尘、尘埃，当时有人感觉不太好，所以改为了 DUT。</p><p><strong>校区概况</strong><sup class="footnote-ref"><a href="#fn2" id="fnref2">[2]</a></sup></p><p>大连理工大学本科招生分为主校区和盘锦校区两部分，分别有独立的招生院校代码，招生时分别录取，考生填报志愿时应分别填报。</p><p>主校区（凌水校区）注册地址为辽宁省大连市凌工路 2 号，大连开发区校区（软件学院）注册地址为辽宁省大连市金普新区图强路 321 号，二者招生院校代码一致，均为<strong> 10141</strong>；</p><p>盘锦校区注册地址为辽宁省盘锦市辽东湾新区大工路 2 号，招生院校代码为<strong> 19141</strong>。</p><p><strong>三个校区颁发相同的大连理工大学毕业证书和学位证书。</strong></p><h2 id="地理位置及交通" tabindex="-1">地理位置及交通 <a class="header-anchor" href="#地理位置及交通" aria-label="Permalink to &quot;地理位置及交通&quot;">​</a></h2><ul><li>大连理工大学凌水校区位于<a href="https://surl.amap.com/1WcIljc71z3YA" target="_blank" rel="noreferrer">辽宁省大连市凌工路 2 号</a>，包含主校区和西部校区两个名义上的分校区，实际二者都在同一个校园内，同时<a href="https://www.cbead.cn/" target="_blank" rel="noreferrer">中国大连高级经理学院</a>也位于大连理工校内，附近有 406 路， 901 路，10 路公交，交通非常方便；</li><li>大连理工大学开发区校区位于<a href="https://surl.amap.com/1WT8dUnF2eOz" target="_blank" rel="noreferrer">辽宁省大连市金普新区图强路 321 号</a>，又称为大连理工大学软件学院，位于金州区，距离主校区通勤班车大约 2 小时路程，院系设置包括软件学院、国际信息与软件学院和集成电路学院（原微电子学院）； <ul><li>如需自行从开发区校区前往凌水主校区，可先打车到保税区轻轨站，乘坐 3 号线到香炉礁轻轨站，然后再打车到凌水主校区，返程同理</li></ul></li><li>大连理工大学盘锦校区位于<a href="https://surl.amap.com/1X96RsRRtaDx" target="_blank" rel="noreferrer">辽宁省盘锦市辽东湾新区大工路 2 号</a>，简称大盘，位于盘锦市，有来往校车，但高铁相对更快；</li></ul><p>在大连，大工的学生卡（玉兰卡）具有交通卡的功能（虽然本人还没有尝试过），可以用来刷大连的公交和地铁。</p><h2 id="军训与体育" tabindex="-1">军训与体育 <a class="header-anchor" href="#军训与体育" aria-label="Permalink to &quot;军训与体育&quot;">​</a></h2><h3 id="军训" tabindex="-1">军训 <a class="header-anchor" href="#军训" aria-label="Permalink to &quot;军训&quot;">​</a></h3><p>军训一般为期 14 天，大约两星期左右，军训教官固定来自中国人民解放军海军大连舰艇学院学员（大二、大三），训练科目为队列、军体拳等。军训结束后之后会进行汇报表演。军训是所有学生培养计划中的一部分，有学分要求，因此一般不能免训，但可以通过相关疾病证明进行军训的旁听。</p><p>军训期间必然诗朗诵，这是传统，主要就是歌颂祖国之类红色的诗歌。</p><h3 id="体育课" tabindex="-1">体育课 <a class="header-anchor" href="#体育课" aria-label="Permalink to &quot;体育课&quot;">​</a></h3><p>一般体育课为 2 学年 4 个学期。</p><p>第一学期没得选，就是基础体能。 就是各种常见的跑跳引体向上什么的。最后有个体侧。推荐中长跑一定要搞定，因为分数占比最多。引体向上直接放弃吧。</p><p>第二学期可以按照兴趣选择 1 项 + 1 项。</p><p>第三学期则只能选择一项。 第四学期延续第三学期的选择。</p><p>学校考虑部分学生存在先天疾病等情况，体育课程中包含部分低强度课程，如：太极拳、定向越野、舞龙舞狮等。</p><p>可以在选课阶段视自身情况来选课（每学期固定时间段抢课，抢不到就悲了）；当然如果发现一节课都没有，那就是教务处放课不足，可以去那里要求加课（问辅导员）。</p><p>体育课程减免方面，根据医院出具的疾病证明可进入康复班进行学分进修，但不能完全免修体育课程。</p><h3 id="体测" tabindex="-1">体测 <a class="header-anchor" href="#体测" aria-label="Permalink to &quot;体测&quot;">​</a></h3><p>体测可通过疾病相关证明进行免修（非学分项目）。</p><h2 id="宿舍情况与基础设施" tabindex="-1">宿舍情况与基础设施 <a class="header-anchor" href="#宿舍情况与基础设施" aria-label="Permalink to &quot;宿舍情况与基础设施&quot;">​</a></h2><h3 id="凌水校区" tabindex="-1">凌水校区<sup class="footnote-ref"><a href="#fn3" id="fnref3">[3]</a></sup> <a class="header-anchor" href="#凌水校区" aria-label="Permalink to &quot;凌水校区[^3]&quot;">​</a></h3><h4 id="本科生" tabindex="-1">本科生 <a class="header-anchor" href="#本科生" aria-label="Permalink to &quot;本科生&quot;">​</a></h4><p><strong>生活设施</strong>：本科生宿舍区为理工大学西山生活区，位于学校内部大山坡上，周边生活设施便利，包括中心食堂、第五食堂、民勇美式广场以及大学生超市等基本设施。同时包括但不限于以下连锁设施和方便设施：罗森便利店、蜜雪冰城、幸运咖、库迪咖啡、移动营业厅、水果店、理发店。此外校内新建的健身房也在西山生活区中。</p><p><strong>宿舍设施</strong>：西山生活区居住条件较好，四人制寝室，均为独立卫生间（部分宿舍因为老旧问题可能两个宿舍共用一个卫生间）。有公共洗衣房，宿舍内有小型通宵自习室。浴室为以宿舍楼为单位的公共浴室，有隔间和浴帘，浴室一般在当前宿舍楼一楼，不必出宿舍即可洗澡。</p><p>宿舍均接入无线网络，网络速率百兆网 <code>100Mbps</code> 宿舍内独立 AP 共（竞）享（争）信道，目前停止本科生有线网络申请许可，只能使用无线网络，网络使用校园账号统一认证方式上网，采用包月 + 流量计费方式收费<sup class="footnote-ref"><a href="#fn4" id="fnref4">[4]</a></sup>（学生月租 <code>20元/月</code> ，套餐内 <code>100GB</code> 流量，超额流量 <code>1元/GB</code> 进行收费）。</p><p>空调方面，在生活区电路改造之后，学校现已允许学生自行购置空调进行安装。</p><p><strong>宿舍调换和租房</strong>：本科查寝分为学部检查、校部检查以及辅导员检查三个部分，其中学部检查和校部检查主要督导宿舍卫生、学生翘课以及违禁电器等问题（校内曾经因为违禁电器引发宿舍火灾，因此比较重视），查寝人员大多为学生以及不同院系辅导员（院系互查），时间大多为上课期间，因此对于宿舍人员情况并不关注。而本科生管理方面以级队为单位分配辅导员，对于大院系一个级队包含 4-5 个班级，辅导员对每个人基本情况具备一定了解，查寝往往也是在晚上熄灯之前（ <code>22:45~~06:00</code> 本科宿舍断电熄灯），私自调换寝室会被导员抓到。</p><p>申请调换寝室方面，因具体情况以及辅导员决断而异，因生活习惯（如民族饮食，个人疾病）等因素进行宿舍调换的概率较大，个人原因以及室友矛盾等具体情况具体对待。本科生暂无单人居住政策说明，宿舍资源较为紧张，截至当前（ <code>2023.10</code> ）西山校区有两栋高层公寓在建，未来可能有相关政策。</p><p>校外租房居住情况，需要向辅导员报备，以及家长知情，并且在校外租房居住会被要求学生退宿校内宿舍。</p><h4 id="研究生" tabindex="-1">研究生 <a class="header-anchor" href="#研究生" aria-label="Permalink to &quot;研究生&quot;">​</a></h4><p><strong>生活设施</strong>：研究生宿舍区位于大连理工大学北山学生公寓，包括 <code>A, B, C</code> 三个区域，处于学校之外，需要穿过软件园路才能到达。疫情期间修建了从校内通往三个宿舍区的桥梁，可以通过桥梁直接从校内到达。宿舍区嵌入新新园居民区中，周边生活设施便利，包括但不限于：瑞幸咖啡、肯德基、蜜雪冰城、茶百道等。但因此宿舍区周边较为吵闹。</p><p><strong>宿舍设施</strong>：宿舍楼比较老旧，居住条件一般，大多数房间为两人制寝室塞入三张床，因此大部分为三人寝室，独立卫生间，有公共洗衣房。以宿舍楼为单位有公共浴室，但部分宿舍楼男女混住所以需要去其他楼宇洗澡。</p><p>无线网与本科寝室标准一致（接入方式、速率、收费情况），宿舍不停电但有功率限制，个人测试大约为 <code>1200w-1500w</code> 之间，使用烧水壶、吹风机等会引起宿舍内空气开关跳闸，连续三次跳闸之后当前楼栋电气总开关系统会拉黑寝室。电费与本科寝室相同， <code>0.5元/度</code> 电。</p><p><strong>宿舍调换和租房</strong>：研究生阶段所有研究生由几位辅导员统管，研究生查寝只关注卫生情况以及违禁电器，辅导员基本不查寝。可向辅导员提出申请进行宿舍调换，可校外租房，但原则上需要退宿。</p><h4 id="博士生及留学生" tabindex="-1">博士生及留学生 <a class="header-anchor" href="#博士生及留学生" aria-label="Permalink to &quot;博士生及留学生&quot;">​</a></h4><p><strong>生活设施</strong>：博留公寓区位于校内凌水校区东部，附近环境优雅，有博留食堂。</p><p><strong>宿舍设施</strong>：博留公寓大部分为双人间，独立卫浴，寝室功率限制大约为 <code>3000w</code> 名义禁止违禁电器，但功率方面允许用热水壶和吹风机等设备。</p><p><strong>宿舍调换和租房</strong>：与研究生政策相同。</p><h4 id="其他公共设施" tabindex="-1">其他公共设施 <a class="header-anchor" href="#其他公共设施" aria-label="Permalink to &quot;其他公共设施&quot;">​</a></h4><p><strong>自助售货机</strong>：目前基本每栋教学楼、宿舍楼中都有自助售货机，包含矿泉水、日常零食以及冰激凌等，较为方便。</p><p><strong>第三卫生间</strong>：一些楼宇中男女卫生间内包含<strong>无障碍隔间</strong>，部分新建的建筑中有<strong>无障碍卫生间</strong>，但这些无障碍卫生间往往被物业保洁用作工具间或者直接将门反锁。</p><h3 id="开发区校区" tabindex="-1">开发区校区 <a class="header-anchor" href="#开发区校区" aria-label="Permalink to &quot;开发区校区&quot;">​</a></h3><p><strong>生活设施</strong>：宿舍区周边有食堂（共 3 层，顶层有水果店）、大学生超市、移动营业厅、理发店等。新宿舍楼（学生第七宿舍）1 楼有罗森便利店、瑞幸咖啡、健身房、学生活动中心等。</p><p><strong>宿舍设施</strong>：四人制寝室，均为独立卫生间，有公共洗衣房。旧宿舍楼和新宿舍楼 B 区浴室为以宿舍楼为单位的公共浴室，有隔间和浴帘；新宿舍楼 A 区有独立淋浴间。</p><p>校外租房居住情况，需要向辅导员报备，以及家长知情。如果完全无需校内住宿，记得及时退宿，否则仍需支付住宿费。</p><p>其他公共设施方面，和凌水主校区类似，基本每栋教学楼、宿舍楼中都有自助售货机。</p><h2 id="医疗资源" tabindex="-1">医疗资源 <a class="header-anchor" href="#医疗资源" aria-label="Permalink to &quot;医疗资源&quot;">​</a></h2><h3 id="校内医院" tabindex="-1">校内医院 <a class="header-anchor" href="#校内医院" aria-label="Permalink to &quot;校内医院&quot;">​</a></h3><p>大连理工于 2022 年正式成立医学部，下属<a href="https://www.lnszl.com/" target="_blank" rel="noreferrer">附属肿瘤医院</a>、<a href="https://www.dlzxyy.com/" target="_blank" rel="noreferrer">附属中心医院</a>以及附属校医院。</p><p>校医院不能开具激素检查，无法公费购买 HRT 药物，学生医保只能用于大病（如手术，重疾等），<strong>无法用于日常购药以及检查</strong><sup class="footnote-ref"><a href="#fn5" id="fnref5">[5]</a></sup>。</p><p>校内医院收费较贵，诊疗水平一般，为了不延误病情一般建议前往<a href="https://www.shdmu.com/web/homePage/index" target="_blank" rel="noreferrer">大连医科大学附属第二医院</a>（医大二院，此后均已此为代称，并且此处的医大二院指的是星海院区）进行就诊，公交车程大约 30 分钟左右到达。</p><h2 id="trans相关" tabindex="-1">Trans 相关 <a class="header-anchor" href="#trans相关" aria-label="Permalink to &quot;Trans相关&quot;">​</a></h2><p><strong>刷证及复学证明：</strong></p><p><a href="https://www.haodf.com/hospital/718.html" target="_blank" rel="noreferrer">大连市第七人民医院</a>，大连市三级甲等医院<sup class="footnote-ref"><a href="#fn6" id="fnref6">[6]</a></sup>，距离理工大学西门 <code>800m</code> 左右，步行 5 分钟即可到达，刷证方便。具体攻略可以参考 <code>mtf.wiki</code> 上的<a href="https://mtf.wiki/zh-cn/docs/psyco/liaoning/liu-hong/" target="_blank" rel="noreferrer">相关页面</a>。可以通过医院的微信小程序进行挂号、缴费，提前一周放号。</p><p><strong>激素检查：</strong></p><p>激素检查推荐去医大二院进行检测，血液检测可以通过以下方式开具：</p><ul><li>线下方便门诊：位于门诊二楼，在窗口挂号方便门诊，之后在报道机器上报道等号，方便门诊医生会简单询问个人情况，做检查的原因（计入病历）之后会开具相应的检查；</li><li>内分泌科 / 生殖科 / 男科 / 妇科：挂号内分泌科向医生说明情况即可开检查，部分医生友跨（下述），或者可以挂生殖医学相关科室，可做<strong>染色体检查</strong>，MtF 可以尝试挂男科进行相关检查单的开具（男科一般就诊人数较少，比较好挂），如果 GD 严重则不建议；</li><li>线上问诊开检查：在医大二院小程序上，选择在线问诊，搜索<strong>苏本利</strong>医生进行问诊，缴纳问诊费用 <code>9.6元</code> 之后可向医生要求开具具体项目的激素检查，以 <code>睾酮</code> 、 <code>泌乳素</code> 、 <code>雌二醇</code> 三项检查为例，检查费用为 <code>174.2元</code> ，包含检测费用以及相关耗材费用；</li></ul><p><strong>HRT 处方：</strong></p><p>持有正规精神医院开具的易性症相关病历（小证）或易性症诊断证明（大证），可以到医大二院内分泌科开具 HRT 处方，药物方面会开国色（华典，醋酸环丙孕酮， <code>50mg/t</code> 规格）和国补（拜尔，补佳乐， <code>1mg/t</code> 规格），部分药物需要去院外购买（此处存疑）。</p><p><strong>药品购买：</strong></p><p>截至目前（ <code>2023.10</code> ）个人探访学校周边，主要为理工西门和理工北门两个方向各大药店，其中理工西门有一家药店能够购买补佳乐，单价 <code>32.5元</code> ；理工北门附近多家药店备有一定数量的补佳乐，单价 <code>32元</code> 。购买药物时店内药师一般不会询问药品用途。</p><p>目前未见雌二醇凝胶以及色谱龙等药品在售。</p><h2 id="lgbt-友善梗概" tabindex="-1">LGBT 友善梗概 <a class="header-anchor" href="#lgbt-友善梗概" aria-label="Permalink to &quot;LGBT 友善梗概&quot;">​</a></h2><p>很多专业存在很难毕业的情况。著名的化工专业则是要求更严，挂科率更高，虽然这个专业是王牌专业。本科毕业只要不随便玩还是可以的（虽然有 “有机物化，必有一挂” 的说法）。硕士一定要选一个好导师，有一些导师真的比较差。</p><blockquote><p>就算不是性少数什么的，也会有抑郁崩溃掉的（周围的人都被强制心理咨询）。好像疫情期间就有化工硕士出过事。学校对此类事件消息管控异常严格，如果没有在新闻上有报道，除非是亲眼见到否则是很难知道的。</p></blockquote><p><strong>LGBT 人群方面</strong>：凌水校区理工科氛围浓厚，因此深柜比例巨大，处于各种考虑很多人并不愿意现身，甚至存在住在隔壁四年不知对方是跨的情况。</p><p><strong>LGBT 社群方面</strong>：没有相关的公开的社团组织，以及相关的科普。部分社团如动漫社等，相对存在更多更为友跨，以及对相关内容了解更多的人。据称校内有 L 和 G 自发形成的群组，群员定期举行聚会等活动，详细情况有待考证。</p><p><strong>LGBT 友善方面</strong>：除去深柜因素，多数人对于性别认同、性取向等议题没有兴趣，因此主要以为人而不是其他来看待你。教师方面，部分辅导员和导师友跨，但也因人而异。</p><p>主要遵循<strong>相互尊重，相安无事</strong>的相处原则。根据本人 RLE 过程中实际调研，学校并未有相关的政策或规定对跨性别进行限制，如门卫、行政老师等可能会注视、不解，但并不会对跨儿进行盘问、限制。因此，总体来讲，只要不做给辅导员、导师等人带来额外工作量的事情，学校对 LGBT 整体上处于无视状态。</p><p><strong>心理咨询方面</strong>：学校定期会进行心理测评以及对心理状态” 异常 “（主要是抑郁症等）的学生拉清单关注，防止出现学生伤害自己的情况。但学校心理咨询方面对于性别议题的讨论和了解较少。心理咨询预约较为方便，一般较少会有人去。推荐 trans 直接去大连七院，可能在宿舍就能直接看到七院的身影。</p><h3 id="跨性别分布情况" tabindex="-1">跨性别分布情况 <a class="header-anchor" href="#跨性别分布情况" aria-label="Permalink to &quot;跨性别分布情况&quot;">​</a></h3><p><strong>凌水校区</strong>：目前已知的 MTF 在校 3 人左右，分布在电信学部以及医学部。</p><p><strong>盘锦校区</strong>：大约 MTF 在校 4 人左右，分布在化工学院。</p><h3 id="院系探路" tabindex="-1">院系探路 <a class="header-anchor" href="#院系探路" aria-label="Permalink to &quot;院系探路&quot;">​</a></h3><p><strong>电信学部</strong></p><p>总体上处于冷漠状态，每个人都在忙自己的事情，如果不生事基本上没人管你。</p><blockquote><p>但具体而言，可能部分年长的老师对于 LGBT 不甚接受，如果在课题组 RLE 的话，可能会招致责难。部分老师对课题组女生化妆、染发等行为进行指责和干预。</p></blockquote><p>综合而言还是因人而异，想要麻烦少一些的话，可以选择年轻老师或者在学术、工作方面精力投入较多的老师，相应的只要做好手头的事情，一般而言导师不会干预个人的行为。</p><p>不过无论哪个专业，本科阶段寻找一些历年的期末题有助于大大提高成绩；研究生阶段选择一位好导师可以比较愉快度过研究生生涯，这一点十分重要。</p><h2 id="其他信息" tabindex="-1">其他信息 <a class="header-anchor" href="#其他信息" aria-label="Permalink to &quot;其他信息&quot;">​</a></h2><h3 id="参考链接" tabindex="-1">参考链接 <a class="header-anchor" href="#参考链接" aria-label="Permalink to &quot;参考链接&quot;">​</a></h3><p>正文中部分内容采编截至（ <code>2023.10</code> ），相关链接通过脚注方式在正文中注明以确保准确。</p><hr><h2 id="投稿人联系方式" tabindex="-1">投稿人联系方式 <a class="header-anchor" href="#投稿人联系方式" aria-label="Permalink to &quot;投稿人联系方式&quot;">​</a></h2><h3 id="贡献者姓名" tabindex="-1">贡献者姓名 <a class="header-anchor" href="#贡献者姓名" aria-label="Permalink to &quot;贡献者姓名&quot;">​</a></h3><h3 id="半生-凌水主校区" tabindex="-1">半生（凌水主校区） <a class="header-anchor" href="#半生-凌水主校区" aria-label="Permalink to &quot;半生（凌水主校区）&quot;">​</a></h3><ul><li>QQ：412341435</li><li>E-Mail：<a href="mailto:lambda.sewen@outlook.com" target="_blank" rel="noreferrer">lambda.sewen@outlook.com</a></li></ul><h3 id="高桐-已毕业" tabindex="-1">高桐（已毕业） <a class="header-anchor" href="#高桐-已毕业" aria-label="Permalink to &quot;高桐（已毕业）&quot;">​</a></h3><ul><li>QQ：2441743337</li><li>email: <a href="mailto:enzogko@outlook.com" target="_blank" rel="noreferrer">enzogko@outlook.com</a></li></ul><h3 id="七翼式-已毕业" tabindex="-1">七翼式（已毕业） <a class="header-anchor" href="#七翼式-已毕业" aria-label="Permalink to &quot;七翼式（已毕业）&quot;">​</a></h3><ul><li>QQ：1432657529</li><li>email: <a href="mailto:gaojingjingjing@outlook.com" target="_blank" rel="noreferrer">gaojingjingjing@outlook.com</a></li></ul><h3 id="integral-开发区校区" tabindex="-1">Integral（开发区校区） <a class="header-anchor" href="#integral-开发区校区" aria-label="Permalink to &quot;Integral（开发区校区）&quot;">​</a></h3><ul><li>Telegram: <a href="https://t.me/Integral-Tech" target="_blank" rel="noreferrer">@Integral-Tech</a></li><li>E-Mail: <a href="mailto:integral@member.fsf.org" target="_blank" rel="noreferrer">integral@member.fsf.org</a></li></ul><hr class="footnotes-sep"><section class="footnotes"><ol class="footnotes-list"><li id="fn1" class="footnote-item"><p><a href="https://www.dlut.edu.cn/xxgk/xxjj.htm" target="_blank" rel="noreferrer">https://www.dlut.edu.cn/xxgk/xxjj.htm</a> <a href="#fnref1" class="footnote-backref">↩︎</a></p></li><li id="fn2" class="footnote-item"><p><a href="https://zs.dlut.edu.cn/info/1020/2566.htm" target="_blank" rel="noreferrer">https://zs.dlut.edu.cn/info/1020/2566.htm</a> <a href="#fnref2" class="footnote-backref">↩︎</a></p></li><li id="fn3" class="footnote-item"><p><a href="https://colleges.chat/universities/da-lian-li-gong-da-xue/" target="_blank" rel="noreferrer">https://colleges.chat/universities/da-lian-li-gong-da-xue/</a> <a href="#fnref3" class="footnote-backref">↩︎</a></p></li><li id="fn4" class="footnote-item"><p><a href="https://its.dlut.edu.cn/index/sfbz.htm" target="_blank" rel="noreferrer">https://its.dlut.edu.cn/index/sfbz.htm</a> <a href="#fnref4" class="footnote-backref">↩︎</a></p></li><li id="fn5" class="footnote-item"><p><a href="https://gs.dlut.edu.cn/info/1199/7544.htm" target="_blank" rel="noreferrer">https://gs.dlut.edu.cn/info/1199/7544.htm</a> <a href="#fnref5" class="footnote-backref">↩︎</a></p></li><li id="fn6" class="footnote-item"><p><a href="http://www.a-hospital.com/w/%E5%A4%A7%E8%BF%9E%E5%B8%82%E4%B8%89%E7%BA%A7%E7%94%B2%E7%AD%89%E5%8C%BB%E9%99%A2%E5%88%97%E8%A1%A8" target="_blank" rel="noreferrer">http://www.a-hospital.com/w/ 大连市三级甲等医院列表</a> <a href="#fnref6" class="footnote-backref">↩︎</a></p></li></ol></section>',104)]))}const g=e(l,[["render",n]]);export{f as __pageData,g as default};
